import React, { useContext } from 'react'
import { StyleSheet, Text, Touchable, View, TouchableOpacity} from 'react-native'
import AuthContext from '../contexts/AuthContext'

export default function RoomIcon(props) {
    const {setRoomCode} = useContext(AuthContext)

    const gotoRoom = () => {
        console.log('presssed here ' + props.roomCode)
        setRoomCode(props.roomCode)
    }
    return (
        <TouchableOpacity style={styles.RoomIconContainer} onPress={() => gotoRoom()}>
            <View >
            </View>
        </TouchableOpacity>

    )
}

const styles = StyleSheet.create({
    RoomIconContainer: {
        margin: 5,
        backgroundColor: '#000',
        borderRadius: 20,
        minWidth: 60,
        minHeight: 60,
        maxWidth: 60,
        maxHeight: 50,
        zIndex: 200
    }
})
